import React from "react";
import Header from "../../common/header/Header";
import "./Home.css";




export default function Home(props){
    return(
        <div className="home">
            <div className="header">    
                <Header/>
            </div>
            <div className="heading">
                Upcoming Movies
            </div>
        </div>
    )
}
